	  350580,"[1]",7439,12,1948,
	  "0.25 USD",148.000,NULL,"According to \"OtherEric\" at http://goldenagecomics.co.uk/ his copy of this contains:  a 16-page signature Jo-Jo (Fox 1947 series) #20 Western Thrillers (Fox 1948 series) #2 Phantom Lady (Fox 1947 series) #19 and Famous Crimes (Fox 1948 series) #3.  Only the contents of the first signature are indexed here.  Date listed is copyright date.",
