	  350581,NULL,23091,1306,1946,
	  "0.10 USD",36.000,NULL,"No indicia in the book.  Patoruzu appears on cover only as contents of book being indexed is an otherwise unreleased issue of Fox \"Animal Crackers\" later released as Leo the Lion (I. W. Publishing; Super Comics) #1.  It is likely therefore that this was released in the early 1950's though the covers were printed much earlier.  Another copy found to contain From Here to Insanity #10 (Charlton June 1955). A copy also contains Animal Crackers #31 (Fox July 1950).",
	  NULL,NULL,NULL,NULL,NULL,NULL
